import React, { useState } from 'react';
import moment from 'moment';

const TimeLeft = ({sessionLengthSec}) => {

    const [timeLeft] = useState(sessionLengthSec)

    return(
        <div>
            <p>{moment.duration(timeLeft,'s').minutes()}</p>
        </div>
    )
}
export default TimeLeft;
